import React, {Component} from 'react';
import {Col,Container,Row} from 'react-bootstrap';

//component
import ListLatestPlayers from '../../players/component/ListLatestPlayers'
import CardTopPlayers from '../../players/component/CardTopPlyers';
import PieChartAllReports from '../../reportType/PieChartAllReports';
//css
import  './homepage.scss'

class HomePage extends Component {
    
    render() {
        return(
            <Container fluid>
                <Row>
                    <Col className='list-top-players'>
                        <h2>TOP REPORTED</h2>
                        <CardTopPlayers/>
                    </Col>
                    <Col  className='pie-chart'>
                        <PieChartAllReports region='euw'/>
                    </Col>
                    <Col   className='list-latest-players'>
                        <h2>LAST REPORTED</h2>
                        <div className='last-reported'><ListLatestPlayers/></div>
                    </Col>
                </Row>
            </Container>
        );
    }
}
export default HomePage;
